	add("part", "{\"term\":\"part\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) {{m|enm|part}}, from Old english (ca. 450-1100) {{m|ang|part||part}} and Old french (842-ca. 1400) {{m|fro|part||part}}; both from Latin {{m|la|partem}}, accusative of {{m|la|pars||piece, portion, share, side, party, faction, role, character, lot, fate, task, lesson, part, member}}, from Proto-indo-european {{m|ine-pro|*par-}}, {{m|ine-pro|*per-||to cut, bore}}. Akin to {{m|la|portio||a portion, part}}, {{m|la|parare||to make ready, prepare}}. Displaced Middle english (1100-1500) {{m|enm|dele|del, dele|part}} (from Old english (ca. 450-1100) {{m|ang|dǣl||part, distribution}}), Middle english (1100-1500) {{m|enm|dale||part, portion}} (from Old english (ca. 450-1100) {{m|ang|dāl||portion}}), Middle english (1100-1500) {{m|enm|sliver||part, portion}} (from Middle english (1100-1500) {{m|enm|sliven||to cut, cleave}}, from Old english (ca. 450-1100) {{m|ang|toslifan|(tō)slīfan|to split}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A portion; a component\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fraction of a whole\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Hepaticology, outside the temperate \u0027\u0027parts\u0027\u0027 of the Northern Hemisphere, still lies deep in the shadow cast by that ultimate \u0026quot;closet taxonomist,\u0026quot; Franz Stephani—a ghost whose shadow falls over us all\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/leaders/21578665-nearly-1-billion-people-have-been-taken-out-extreme-poverty-20-years-world-should-aim Towards the end of passage\u003dAmerica’s poverty line is $63 a day for a family of four. In the richer \u0027\u0027parts\u0027\u0027 of the emerging world $4 a day is the poverty barrier. But poverty’s scourge is fiercest below $1.25 ([\u0026amp;hellip;]): people below that level live lives that are poor, nasty, brutish and short\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A distinct element\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d8|passage\u003dIt had been arranged as \u0027\u0027part\u0027\u0027 of the day\u0027s programme that Mr. Cooke was to drive those who wished to go over the Rise in his new brake\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/technology-quarterly/21567193-networking-enthusiasts-dream-building-drone-powered-internet-carry-objects An internet of airborne passage\u003dA farmer could place an order for a new tractor \u0027\u0027part\u0027\u0027 by text message and pay for it by mobile money-transfer. A supplier many miles away would then take the \u0027\u0027part\u0027\u0027 to the local matternet station for airborne dispatch via drone\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A group inside a larger group\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Share, especially of a profit\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A unit of relative proportion in a mixture\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"3.5 centiliters of one ingredient in a mixed drink\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A section of a document\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A section of land; an area of a country or other territory; region\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, \u0027\u0027, II.vi\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"the Faery knight / Besought that Damzell suffer him depart, / And yield him readie passage to that other \u0027\u0027part\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A factor\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A room in a public building, especially a courtroom\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Duty; responsibility\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Position or role (especially in a play\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d2|passage\u003dWe drove back to the office with some concern on my \u0027\u0027part\u0027\u0027 at the prospect of so large a case. Sunning himself on the board steps, I saw for the first time Mr. Farquhar Fenelon Cooke. He was dressed out in broad gaiters and bright tweeds, like an English tourist, and his face might have belonged to Dagon, idol of the Philistines\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dHe was thinking; but the glory of the song, the swell from the great organ, the clustered lights,, the height and vastness of this noble fane, its antiquity and its strength—all these things seemed to have their \u0027\u0027part\u0027\u0027 as causes of the thrilling emotion that accompanied his thoughts\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"The melody played or sung by a particular instrument, voice, or group of instruments or voices, within a polyphonic piece\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"Each of two contrasting sides of an argument, debate etc.; \u0026quot;hand\u0026quot\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"II.15\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"the fruition of life cannot perfectly be pleasing unto us, if we stand in any feare to lose it. A man might nevertheless say on the contrary \u0027\u0027part\u0027\u0027, that we embrace and claspe this good so much the harder, and with more affection, as we perceive it to be less sure, and feare it should be taken from us\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"Bible, ix.40\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"He that is not against us is on our \u0027\u0027part\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"1606-1687\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"Make whole kingdoms take her brother\u0027s \u0027\u0027part\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"The dividing line formed by combing the hair in different directions\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"In the Hebrew lunisolar calendar, a unit of time equivalent to 3⅓ seconds\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"A constituent of character or capacity; quality; faculty; talent; usually in the plural with a collective sense\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"1729-1797\", \"priority\":33},{\"upperType\":\"NOUN\", \"text\":\"men of considerable \u0027\u0027parts\", \"priority\":34},{\"upperType\":\"NOUN\", \"text\":\"1800-1859\", \"priority\":35},{\"upperType\":\"NOUN\", \"text\":\"great quickness of \u0027\u0027parts\", \"priority\":36},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":37},{\"upperType\":\"NOUN\", \"text\":\"which maintained so politic a state of evil, that they will not admit any good \u0027\u0027part\u0027\u0027 to intermingle with them\", \"priority\":38}]}, \"synonyms\":{}}");

