	add("paraclete", "{\"term\":\"paraclete\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027paraclit\u0027 from \u0027paraclet\u0027 from Latin \u0027paracletus\u0027 from Ancient greek (to 1453) \u0027παράκλητος\u0027 (one called to help, helper; comforter; protector, defender; (legal) advocate) from \u0027παρά\u0027 (beside) + \u0027κλητος\u0027 (called, invited [one]) The Greek term is used repeatedly in the New Testament as an epithet of the Holy Spirit.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Holy Spirit, the Holy Ghost, especially in its role as comforter of the faithful\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027, w:Thomas Thomas Pynchon, \u0027V\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The matter of a \u0027\u0027Paraclete\u0027\u0027’s coming, the comforter, the dove; the tongues of flame, the gift of tongues: Pentecost. Third Person of the Trinity\", \"priority\":3}]}, \"synonyms\":{}}");

	add("paraclete", "{\"term\":\"paraclete\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027See\u0027 \u0027\u0027Paraclete\u0027\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An advocate or helpe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027, w:Anthony Anthony Burgess, \u0027Inside Mr Enderby\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He passed a block of bright posters. One of them extolled domestic gas: a smiling toy \u0027\u0027paraclete\u0027\u0027 called Mr Therm presided over a sort of warm Holy Family\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the Holy Spirit or Holy Ghost\", \"priority\":4}]}, \"synonyms\":{}}");

	add("paraclimax", "{\"term\":\"paraclimax\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|climax|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A relatively stable community of foreign plants established after the destruction, by man, of a native habitat\", \"priority\":1}]}, \"synonyms\":{}}");

