	add("paracosm", "{\"term\":\"paracosm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027παρά\u0027 (beside, alongside) + \u0027κόσμος\u0027 (world, universe)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A detailed imaginary world, especially one created by a child\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Delmont C. Morrison \u0026amp; Shirley Linden Morrison, \u0027Memories of Loss and Dreams of Perfection: Unsuccessful Childhood Grieving and Adult Creativity\u0027, Baywood Publishing (2005), ISBN 9780895033093, [http://books.google.com/books?id\u003ddER-AAAAMAAJ\u0026amp;q\u003d%22paracosm%22 page 72\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As Emily [Brontë] turned in on herself for resources, she created a new \u0027\u0027paracosm\u0027\u0027, the Kingdom of Gondal, which she shared with Anne. The \u0027\u0027paracosm\u0027\u0027 of Gondal became a way of life for the sisters; they shared its secrets for the rest of their lives\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Thomas Armstrong, \u0027The Human Odyssey: Navigating the Twelve Stages of Life\u0027, Sterling (2007), ISBN 9781402739965, [http://books.google.com/books?id\u003dHOjrLRMb_goC\u0026amp;pg\u003dPA93\u0026amp;dq\u003d%22paracosm%22 page 93\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One \u0027\u0027paracosm\u0027\u0027 in their study was a country called Branmail consisting totally of cats — except for its creator, a six-year-old girl named Holly who had access to the world by scaling a height called Bumpety Banks\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Sarah Lynne Bowman, \u0027The Functions of Role-Playing Games: How Participants Create Community, Solve Problems and Explore Identity\u0027, McFarland \u0026amp; Company (2010), ISBN 9780786447107, [http://books.google.com/books?id\u003dPn3wR74wDCgC\u0026amp;pg\u003dPA130\u0026amp;dq\u003d%22paracosm%22 page 130\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The children created these inner worlds for a number of reasons, though each \u0027\u0027paracosm\u0027\u0027 tends to be a long-lasting, heavily structured, and internally consistent\", \"priority\":7}]}, \"synonyms\":{\"list\":[{\"text\":\"paracosmos\", \"synonymQualifier\":\"RARE\"}]}}");

	add("paracosmos", "{\"term\":\"paracosmos\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|cosmos|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The realm of imagination; an imaginary world\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027, \u0027The American Journal of Psychiatry\u0027, Volume 117, [http://books.google.com/books?id\u003dews5AAAAMAAJ\u0026amp;q\u003d%22paracosmos%22 page 96\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Day dreaming and fantasies which are flights into the \u0027\u0027paracosmos\u0027\u0027, are an antithesis of creativity which is the most intense land of action\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027, \u0027Molière and the Commonwealth of Letters: Patrimony and Posterity\u0027 (eds. Roger Johnson, Editha S. Neumann, \u0026amp; Guy T. Trail), University Press of Mississippi (1975), [http://books.google.com/books?id\u003dwNdcAAAAMAAJ\u0026amp;q\u003d%22paracosmos%22 page 421\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"More simply stated, the \u0027\u0027paracosmos\u0027\u0027 reflects a writer\u0027s interest in examining a (generally) rather small number of persons, or types of persons, in a variety of circumstances and relationships: he has marked out a portion of the world as his own and works upon it to make it his\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Claire Golomb, \u0027The Creation of Imaginary Worlds: The Role of Art, Magic and Dreams in Child Development\u0027, Jessica Kingsley Publishers (2011), ISBN 9781849058520, [http://books.google.com/books?id\u003ds9FsvCBjd7EC\u0026amp;pg\u003dPA80\u0026amp;dq\u003d%22paracosmos%22 page 80\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Such artists tend to create an imaginary world, a \u0027\u0027paracosmos\u0027\u0027 where good and evil are starkly represented, where evil powers always challenge the good ones and need to be vanquished time and again\", \"priority\":7}]}, \"synonyms\":{}}");

	add("paracusia", "{\"term\":\"paracusia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of hallucination that involves perceiving sounds without auditory stimulus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paracyclophane", "{\"term\":\"paracyclophane\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|para|cyclophane|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any cyclophane in which the aliphatic bridge connects the 1,4 (para) positions of the benzene ring\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parade", "{\"term\":\"parade\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"French\", \"Latin\"], \"text\":\"From French \u0027parade|lang\u003dfr\u0027 () from Spanish \u0027parada\u0027 (a halt, stop, pause, a parade) from \u0027parar\u0027 () from Latin \u0027parare\u0027 (to prepare, in {{etyl) and Rom. also to halt, stop, prevent, guard against, etc., also dress, trim, adorn}}; see pare. Compare parry, a doublet of \u0027parade\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An organized procession consisting of a series of consecutive displays, performances, exhibits, etc. displayed by moving down a street past a crowd\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The floats and horses in the \u0027\u0027parade\u0027\u0027 were impressive, but the marching bands were really amazing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any succession, series, or display of items\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The dinner was a \u0027\u0027parade\u0027\u0027 of courses, each featuring foods more elaborate than the last\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027parade\u0027\u0027 of shops\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A line of goslings led by one parent and often trailed by the other\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The ground where a military display is held, or where troops are drilled\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Pompous show; formal display or exhibition\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Jonathan Swif\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Be rich, but of your wealth make no \u0027\u0027parade\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Posture of defense; guard\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"John Lock\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"when they are not in \u0027\u0027parade\u0027\u0027, and upon their guar\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A public walk; a promenade; now used in street names\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"He was parked on Chester \u0027\u0027Parade\", \"priority\":15}]}, \"synonyms\":{}}");

	add("paradichlorobenzene", "{\"term\":\"paradichlorobenzene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|dichlorobenzene|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1,4-dichlorobenzene, an organic compound used as a pesticide (for example in mothballs) and a deodorant\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paradiddle", "{\"term\":\"paradiddle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Imitative.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A percussive exercise (one of 26 drum rudiments) which involves playing four even strokes in the order ‘right left right right’ or ‘left right left left’\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paradigm", "{\"term\":\"paradigm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Established 1475-85 from \u0027paradīgma\u0027 from Ancient greek (to 1453) \u0027παράδειγμα\u0027 (pattern)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An example serving as a model or pattern; a template\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0026quot;s:Estate of William F. Jenkins v. Paramount Pictures Estate of William F. Jenkins v. Paramount Pictures Corp.\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"According to the Fourth Circuit, “Coca-Cola” is “the \u0027\u0027paradigm\u0027\u0027 of a descriptive mark that has acquired secondary meaning”\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Nicholas Asher and Alex Lascarides, \u0027Logics of Conversation\u0027, Cambridge University Press, ISBN 0 521 65058 5, page 46\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"DRT is a \u0027\u0027paradigm\u0027\u0027 example of a dynamic semantic theory\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A set of all forms which contain a common element, especially the set of all inflectional forms of a word or a particular grammatical category\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027paradigm\u0027\u0027 of \u0026quot;go\u0026quot; is \u0026quot;go, went, gone.\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A system of assumptions, concepts, values, and practices that constitutes a way of viewing reality\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A conceptual framework—an established thought process\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A way of thinking which can occasionally lead to misleading predispositions; a prejudice. A route of mental efficiency which has presumably been verified by affirmative results/predictions\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A philosophy consisting of ‘top-bottom’ ideas (namely biases which could possibly make the practitioner susceptible to the ‘confirmation bias’\", \"priority\":11}]}, \"synonyms\":{}}");

	add("paradigma", "{\"term\":\"paradigma\", \"etymology\":{\"influencers\":[], \"languages\":[\"ancient greek (to 1453)\", \"Italian\"], \"text\":\"Ancient greek (to 1453)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1844\u0027\u0027: John Holmes Agnew and Walter Hilliard Bidwell, \u0027The Eclectic Magazine\u0027, [http://books.google.co.uk/books?id\u003d2tpMv4OLDpcC\u0026amp;pg\u003dPA569\u0026amp;dq\u003d%22a+paradigma%22\u0026amp;ei\u003d3v-5SI6cNoGSyATDtMXJB\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"PPA569,M1 page 569\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The volume before us presents, first of all, a \u0027\u0027paradigma\u0027\u0027, or specimen sheet, on which each letter of the English alphabet, small and capital, written and printed, is accompanied by its pronunciation in Chinese phonetic signs, as well as in Mandchou letters. \u0026lt;!-- [sic] — præsumably an alternative form of “Manchu”… --\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

	add("paradigmata", "{\"term\":\"paradigmata\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1965\u0027\u0027: F. Warren Rempel, \u0027The Role of Value in Karl Mannheim’s Sociology of Knowledge\u0027, [http://books.google.co.uk/books?id\u003d-Wk1AAAAIAAJ\u0026amp;q\u003d%22these+paradigmata%22\u0026amp;dq\u003d%22these+paradigmata%22\u0026amp;ei\u003d8gG6SI-OF43kywSBuNXGBw\u0026amp;pgis\u003d1 page 88] (Mouton\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"These \u0027\u0027paradigmata\u0027\u0027, these basic visions of life’s meaning, become the foundations for developing levels of value consciousness, as well as the concrete integrating principle of a world-view\", \"priority\":2}]}, \"synonyms\":{}}");

	add("paradise", "{\"term\":\"paradise\", \"etymology\":{\"influencers\":[], \"languages\":[\"Avestan\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Middle english (1100-1500) from Old french (842-ca. 1400) from Latin \u0027paradīsus\u0027 from Ancient greek (to 1453) \u0027παράδεισος\u0027 from {{m|und|*pari-daiza}}, compare Avestan \u0027𐬞𐬀𐬌𐬭𐬌⸱𐬛𐬀𐬉𐬰𐬀\u0027 (walled enclusure, encompassing) from \u0027𐬞𐬀𐬌𐬭𐬌\u0027 (around) and \u0027𐬛𐬀𐬉𐬰𐬀\u0027 (wall) \u0027𐬛𐬀𐬉𐬰𐬀\u0027 (wall) may be from Proto-indo-european {{m|ine-pro|*dʰeyǵʰ-||to knead, form, mold}} (compare {{m|en|dough}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Heaven; the abode of sanctified souls after death\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bible, Luke xxiii. 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To-day shalt thou be with me in \u0027\u0027paradise\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Longfello\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It sounds to him like her mother\u0027s voice, / Singing in \u0027\u0027Paradise\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A very pleasant place\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"an island \u0027\u0027paradise\u0027\u0027 in the Caribbean\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A very positive experience\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An open space within a monastery or adjoining a church, such as the space within a cloister, the open court before a basilica, etc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A churchyard or cemetery\", \"priority\":10}]}, \"synonyms\":{}}");

	add("paradise", "{\"term\":\"paradise\", \"etymology\":{\"influencers\":[], \"languages\":[\"Avestan\", \"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French paradis, from Latin paradisus, from Ancient greek (to 1453) παράδεισος ‘royal park, orchard’, from Avestan \u0027𐬞𐬀𐬌𐬭𐬌𐬸𐬛𐬀𐬉𐬰𐬀\u0027 from \u0027sc\u003davst|tr\u003dpairi|𐬞𐬀𐬌𐬭𐬌\u0027 (around) and \u0027sc\u003davst|tr\u003ddaēza|𐬛𐬀𐬉𐬰𐬀\u0027 (wall)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Heaven\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Garden of Eden\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A town in Californi\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A town in Grenad\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A city in Kansa\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A CDP in Montan\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A town in Newfoundland and Labrado\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A rural locality in New Zealan\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A community in Nova Scoti\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A CDP in Pennsylvani\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A village in Surinam\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A city in Texa\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A town in Uta\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A settlement on the island of Saint Croix in the United States Virgin Islands\", \"priority\":14}]}, \"synonyms\":{}}");

	add("parados", "{\"term\":\"parados\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027parados\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An embankment built to protect the rear of a position from enemy attack\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027, \u0027The Middle Parts of Fortune\u0027, Vintage 2014, p. 309\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He stood up on the step; and then they both swerved, ducking quickly as something ripped up the air between them, flicked a stone from the \u0027\u0027parados\u0027, and sang, like the vibration of a tense wire, into the air behind them\", \"priority\":3}]}, \"synonyms\":{}}");

	add("paradox", "{\"term\":\"paradox\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027paradoxe\u0027 \u0026lt;Latin \u0027paradoxum\u0027 () from Ancient greek (to 1453) \u0027παράδοξος\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A self-contradictory statement, which can only be true if it is false, and vice versa\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;This sentence is false\u0026quot; is a \u0027\u0027paradox\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A counterintuitive conclusion or outcome\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It is an interesting \u0027\u0027paradox\u0027\u0027 that drinking a lot of water can often make you feel thirsty\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027 May 21, \u0026quot;wikisource:Presidential Radio Address - 21 May Presidential Radio Address\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The most fundamental \u0027\u0027paradox\u0027\u0027 is that if we\u0027re never to use force, we must be prepared to use it and to use it successfully\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A claim that two apparently contradictory ideas are true\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Not having a fashion is a fashion; that\u0027s a \u0027\u0027paradox\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A person or thing having contradictory properties\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"He is a \u0027\u0027paradox\u0027\u0027; you would not expect him in that political party\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"An unanswerable question or difficult puzzle, particularly one which leads to a deeper truth\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A statement which is difficult to believe, or which goes against general belief\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1615\u0027\u0027, Ralph Hamor, \u0027A True Discourse of the Present State of Virginia\u0027, Richmond 1957, p\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"they contended to make that \u0027Maxim\u0027, that there is no faith to be held with Infidels, a meere and absurd \u0027\u0027\u0027Paradox\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The use of counterintuitive or contradictory statements (paradoxes) in speech or writing\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Brief Literary page\u003d40|url\u003dhttp://books.google.com/books?id\u003dfWAdAAAAMAAJ|passage\u003dThe need for \u0027\u0027paradox\u0027\u0027 is no doubt rooted deep in the very nature of the use we make of language. }}\u0026lt;!-- original publication must have been no later than 1897, when Hutton died --\u0026gt\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A state in which one is logically compelled to contradict oneself\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dThus, like modern disputants, they aimed either to confute the respondent or to land him in \u0027\u0027paradox\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The practice of giving instructions that are opposed to the therapist\u0027s actual intent, with the intention that the client will disobey or be unable to obey\", \"priority\":19}]}, \"synonyms\":{\"list\":[{\"text\":\"shocker\", \"synonymQualifier\":\"INFORMAL\"}]}}");

	add("paradoxer", "{\"term\":\"paradoxer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|paradox|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Person who comes up with a paradox\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paradoxography", "{\"term\":\"paradoxography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"classical literature dealing with the occurrence of abnormal or inexplicable phenomena of the natural or human world\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paraexciton", "{\"term\":\"paraexciton\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|exciton|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An exciton whose spin is antiparallel to that of its hole\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paraffinization", "{\"term\":\"paraffinization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The embedding of a tissue sample in paraffin wax prior to microtoming\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parafunction", "{\"term\":\"parafunction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|function|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An abnormal (especially habitual) movement of part of the body\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paraganglioma", "{\"term\":\"paraganglioma\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|ganglioma|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rare and typically benign neoplasm that can be found in the abdomen, thorax, or head and neck region\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parage", "{\"term\":\"parage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027parage\u0027 \u0027\u0027 Old french (842-ca. 1400) \u0027parage\u0027 from \u0027pair\u0027 () + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Lineage, parentage; rank, especially as high or noble\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"at souper the knyght sat syr Beumayns afore the damoisel / Fy fy said she syr knyghte ye are vncurtoys to sette a kechyn page afore me hym bysemeth better to stycke a swyne than to sytte afore a damoysel of hyhe \u0027\u0027parage\u0027\u0027 / thenne the knyght was ashamed atte her wordes / and took hym vp / and sette hym at asyde bord / and sette hym self afore hym / and soo al that nyght they had good chere and mery reste\u0026lt;!--Prior quote:‘Sir knyght, ye ar uncurtayse to sette a kychyn page afore me; hym semyth bettir to styke a swyne than to sytte afore a damesell of hyghe \u0027\u0027parage\u0027\u0027.’--\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A feudal institution that recognizes equality of rights and status between two rulers, and equality in the portions of an inheritance\", \"priority\":3}]}, \"synonyms\":{}}");

	add("paragliding", "{\"term\":\"paragliding\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From “paraglider”.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The sport of gliding with a paraglider\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The activity of using a paraglider.\u0026lt;!-- in commerce, photography, surveillance, science, military, industry, entertainment.--\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

	add("paraglobulin", "{\"term\":\"paraglobulin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|globulin|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An albuminous body in blood serum, belonging to the group of globulins\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paragoge", "{\"term\":\"paragoge\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Late Latin. Latin|paragoge\u0027, from Greek \u0027παραγωγή\u0027 ‘derivation, addition’.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The addition of a sound, syllable or letter to the end of a word, either through natural development or as a grammatical function\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paragon", "{\"term\":\"paragon\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Spanish\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Italian\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027paragone\u0027 \u0027peragone\u0027 Middle french (ca. 1400-1600) \u0027paragon\u0027 from Italian \u0027paragone\u0027 (comparison) or Spanish \u0027parangón\u0027 () from \u0027paragonare\u0027 from Ancient greek (to 1453) \u0027παρακονάω\u0027 (i sharpen, whet) from \u0027παρά\u0027 + \u0027ἀκόνη\u0027 (whetstone)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person of preeminent qualities, who acts as a pattern or model of some given (especially positive) quality\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In the novel, Constanza is a \u0027\u0027paragon\u0027\u0027 of virtue who would never compromise her reputation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Man, the \u0027\u0027paragon\u0027\u0027 of animals\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Emerso\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The riches of sweet Mary\u0027s son, / Boy-rabbi, Israel\u0027s \u0027\u0027paragon\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"date\u003d21 October passage\u003dYes, there were instances of grandstanding and obsessive behaviour, but many were concealed at the time to help protect an aggressively peddled narrative of w:Oscar [Oscar] Pistorius the \u0027\u0027paragon\u0027\u0027, the emblem, the trailblazer\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A companion; a match; an equal\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Sir Philip Sidne\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Philoclea, who indeed had no \u0027\u0027paragon\u0027\u0027 but her siste\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Comparison; competition\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, Edmund Spenser, \u0027The Faerie Queene\u0027, III.ix\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"good by \u0027\u0027paragone\u0027\u0027 / Of euill, may more notably be rad, / As white seemes fairer, macht with blacke attone\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The size of type between great primer and double pica, standardized as 20-point\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A flawless diamond of at least 100 carats\", \"priority\":15}]}, \"synonyms\":{}}");

	add("paragraphist", "{\"term\":\"paragraphist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|paragraph|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A writer of paragraphs\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paraguay", "{\"term\":\"paraguay\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Guaraní\"], \"text\":\"Disputed; from Guaraní {{m|gn|Payagua||Payagua tribe}} {{m|gn|i||water}} or {{m|gn|para||river}} {{m|gn|guai||crown}} or {{m|gn|para||river}} {{m|gn|gua||from}} {{m|gn|i||water}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A country in South America; the w:Republic of Republic of Paraguay\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paraguayan", "{\"term\":\"paraguayan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person from Paraguay or of Paraguayan descent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"My mother is a \u0027\u0027Paraguayan\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parahelium", "{\"term\":\"parahelium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|helium|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The form of the helium atom in which the spins of the two electrons are antiparallel\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parahippocampus", "{\"term\":\"parahippocampus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|para|hippocampus|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cortical region of grey matter that surrounds the hippocampus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parahydrogen", "{\"term\":\"parahydrogen\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|hydrogen|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The form of the hydrogen molecule in which the two nuclei have antiparallel spin; about 25% of hydrogen at room temperature\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parainfection", "{\"term\":\"parainfection\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|infection|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A condition resembling an infection but not caused by an infectious agent\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parakeet", "{\"term\":\"parakeet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027perroquet\u0027 probably a diminutive form of the personal name \u0027\u0027 some variant forms perhaps via Italian \u0027parrocchetto\u0027 Spanish \u0027periquito\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of any of the various species of small parrots usually bred in Australia and Africa\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"we had loved them for our pastimes, as we do apes, monkies, or \u0027\u0027perokitoes\u0027\u0027, and not as man\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Patrick Barkham, \u0027The Guardian\u0027, 12 Oct 2009\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"According to one legend, the \u0027\u0027parakeets\u0027\u0027 escaped from the set of The African Queen, John Huston\u0027s 1951 film made at Shepperton studios\", \"priority\":4}]}, \"synonyms\":{}}");

	add("paralanguage", "{\"term\":\"paralanguage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|language|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The non-verbal elements of speech, and to a limited extent of writing, used to modify meaning and convey emotion, such as pitch, volume, and intonation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paralaurionite", "{\"term\":\"paralaurionite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|laurionite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monoclinic-prismatic mineral containing chlorine, hydrogen, lead, and oxygen\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paraleipsis", "{\"term\":\"paraleipsis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027παράλειψις\u0027 (omission) from \u0027παραλείπω\u0027 (i pass over) from \u0027παρά\u0027 (by, near) + \u0027λείπω\u0027 (i leave)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A figure of speech in which one pretends to ignore or omit something by actually mentioning it, as in: \u0026quot;I will not speak of my adversary\u0027s scandalous venality and rapacity, his brutal conduct, his treachery and malice\u0026quot\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paralinguistics", "{\"term\":\"paralinguistics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|linguistics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of paralanguage\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parallelepiped", "{\"term\":\"parallelepiped\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Solid figure, having six faces, all parallelograms; all opposite faces being similar and parallel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A cuboid is a rectangular \u0027\u0027parallelepiped\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parallelism", "{\"term\":\"parallelism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From {{suffix|parallel|ism|lang\u003den}} and from \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being parallel; agreement in direction, tendency, or character\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being in agreement or similarity; resemblance, correspondence, analogy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1946\u0027\u0027, \u0027History of Western Philosophy\u0027, I.29\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Plutarch (\u0027c.\u0027 AD 46-120), in his \u0027Lives of the Noble Grecians and Romans\u0027, traced a \u0027\u0027parallelism\u0027\u0027 between the most eminent men of the two countries\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A parallel position; the relation of parallels\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The juxtaposition of two or more identical or equivalent syntactic constructions, especially those expressing the same sentiment with slight modifications, introduced for rhetorical effect\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The doctrine that matter and mind do not causally interact but that physiological events in the brain or body nonetheless occur simultaneously with matching events in the mind\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In antitrust law, the practice of competitors of raising prices by roughly the same amount at roughly the same time, without engaging in a formal agreement to do so\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Similarity of features between two species resulting from their having taken similar evolutionary paths following their initial divergence from a common ancestor\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The use of parallel methods in hardware or software\", \"priority\":10}]}, \"synonyms\":{}}");

	add("parallelogram", "{\"term\":\"parallelogram\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027parallélogramme\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|right|A parallelogram\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A convex quadrilateral in which each pair of opposite edges are parallel and of equal length\", \"priority\":2}]}, \"synonyms\":{}}");

	add("paralogism", "{\"term\":\"paralogism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027paralogisme\u0027 form Latin \u0027paralogismus\u0027 from Ancient greek (to 1453) \u0027παραλογισμός\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fallacious argument or illogical conclusion, especially one committed by mistake, or believed by the speaker to be logical\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1646\u0027\u0027, Sir Thomas Browne, \u0027Pseudodoxia Epidemica\u0027, III.ii\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Which is a \u0027\u0027Paralogism\u0027\u0027 not admittible; a fallacy that dwels not in a cloud, and needs not the Sun to scatter it\", \"priority\":3}]}, \"synonyms\":{}}");

	add("paralympics", "{\"term\":\"paralympics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|Olympics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Paralympic Games, a counterpart of the Olympic Games, nowadays at the same venue, designed for handicapped athletes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paralytic", "{\"term\":\"paralytic\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027παραλυτικός\u0027 (paralyzed)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone suffering from paralysis\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paralyzer", "{\"term\":\"paralyzer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|paralyze|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who or that which paralyze\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paramagnetism", "{\"term\":\"paramagnetism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The tendency of magnetic dipoles to align with an external magnetic field; materials that exhibit this tendency become temporary magnets\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paramania", "{\"term\":\"paramania\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an uncontrollable urge to complain\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paramecium", "{\"term\":\"paramecium\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027παραμήκης\u0027 (oval) from \u0027μῆκος\u0027 (length)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An oval-shaped protozoan organism of the genus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, Robert Drewe, \u0027The Bodysurfers\u0027, Penguin 2009, p. 144\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The sun beats on his eyelids; inside them a \u0027\u0027paramecium\u0027\u0027 revolves. A blink and it changes pattern like a kaleidoscope\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, , 2003 edition, ISBN 0684848155, page 560\u0026amp;nbsp;[http://google.com/books?id\u003dUg3ArDMHLnQC\u0026amp;pg\u003dRA1-PA560\u0026amp;dq\u003dparamecia\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Edgar noticed that Clyde was wearing a necktie with a driblet design. The little figures made him think of \u0027\u0027paramecia\u0027\u0027, sinister organisms with gullets and feeding grooves\", \"priority\":5}]}, \"synonyms\":{}}");

	add("parament", "{\"term\":\"parament\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027parement\u0027 Middle french (ca. 1400-1600) \u0027parement\u0027 from \u0027\u0027 from Latin \u0027parare|lang\u003dla\u0027 () + \u0027mensam\u0027 (table)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of elaborate robe especially as worn by someone in power or a religious official\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A liturgical hanging on and around the altar, as well as the cloth hanging from the pulpit and lectern\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A hanging or ornament of a room of state\", \"priority\":3}]}, \"synonyms\":{}}");

	add("parameter", "{\"term\":\"parameter\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027paramètre\u0027 from \u0027parametrum\u0027 () from Ancient greek (to 1453) \u0027παρά\u0027 (beside) + \u0027μέτρον\u0027 (measure)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A variable kept constant during an experiment, calculation or similar\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An input variable of a procedure definition, that gets an actual value (argument) at execution time \u0027(formal parameter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Roughly, a tuple of arguments could be thought of as a vector, whereas a tuple of \u0027\u0027parameters\u0027\u0027 could be thought of as a covector (i.e., linear functional). When a function is called, a \u0027\u0027parameter\u0027\u0027 tuple becomes \u0026quot;bound\u0026quot; to an argument tuple, allowing the function instance itself to be computed to yield a return value. This would be roughly analogous to applying a covector to a vector (by taking their dot product (or, rather, matrix-product of row vector and column vector)) to obtain a scalar\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An actual value given to such a formal parameter \u0027(argument or actual parameter\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A characteristic or feature that distinguishes something from others\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In the ellipse and hyperbola, a third proportional to any diameter and its conjugate, or in the parabola, to any abscissa and the corresponding ordinate\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027parameter\u0027\u0027 of the principal axis of a conic section is called the latus rectum\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The ratio of the three crystallographic axes which determines the position of any plane\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The fundamental axial ratio for a given species\", \"priority\":9}]}, \"synonyms\":{}}");

	add("parametricism", "{\"term\":\"parametricism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|parametric|ism|lang\u003den}}, coined in 2008 by Patrik Schumacher.\u0026lt;ref\u0026gt;Patrik Schumacher, \u0027The Autopoiesis of Architecture\u0027, volume 1 (2011, ISBN 1119990491): \u0026quot;The term Parametricism was first put forward by the author during the 2008 Venice Architecture Biennale.\u0026quot;\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An avant-garde, computer-aided style of architecture and urban planning in which (the functions of) spaces are considered parametrically variable (dynamic) rather than static\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, David Joselit, \u0027After Art\u0027 (ISBN 0691150443), page 24\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The question of \u0027\u0027Parametricism\u0027s\u0027\u0027 “hegemony” has been a subject of lively debate among architects, who disagree over whether its design language\u0026amp;mdash;which is based on the scripting of variable stems though digital algorithms\u0026amp;mdash;may be considered a style whose signature aspects would be an undulating topographical field composed of modular geometric elements, or whether the digital modelling capacities that \u0027\u0027Parametricism\u0027\u0027 relies on should remain \u0027tools\u0027 for designing a more materially based and responsive form of architecture\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, \u0027Paradigms in Computing: Making, Machines, and Models\u0027 (ISBN 1938740114), page 185\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"According to the functional heuristics of \u0027\u0027parametricism\u0027\u0027, the functions of spaces are conceived in terms of dynamic patterns of social interactions/communications, i.e. as parametrically variable, dynamic event scenarios, rather than static schedules of accommodation that list functional stereotypes. See Patrik Schumacher, \u0027The Autopoiesis of Architecture\", \"priority\":5}]}, \"synonyms\":{}}");

	add("paramilitary", "{\"term\":\"paramilitary\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|military|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group of civilians trained and organized in a military fashion, but which do not represent the formal forces of a sovereign power\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A member of a paramilitary group\", \"priority\":2}]}, \"synonyms\":{}}");

	add("paramorphine", "{\"term\":\"paramorphine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A poisonous alkaloid, also known as \u0027thebaine\u0027, obtained from opium; not used in medicine; but used as a precursor for the manufacture of some medicines\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paramorphism", "{\"term\":\"paramorphism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|para|morphism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a change in the physical structure of a mineral without any chemical change\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paramythia", "{\"term\":\"paramythia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003dmul}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A town in Greece located in the Thesprotia prefecture\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paranatellon", "{\"term\":\"paranatellon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A star (or constellation) that rises (above the horizon) at the same time as another\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paranatrolite", "{\"term\":\"paranatrolite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|natrolite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monoclinic-domatic mineral containing aluminum, calcium, hydrogen, oxygen, potassium, silicon, and sodium\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paraparticle", "{\"term\":\"paraparticle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|particle|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The equivalent of a particle in any of several parastatistics\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parapet", "{\"term\":\"parapet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) {{m|frm|parapet}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A low retaining wall\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Part of a perimeter that extends above the roof\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A fortification consisting of a wall\", \"priority\":3}]}, \"synonyms\":{}}");

	add("paraph", "{\"term\":\"paraph\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"Image:JohnHancockSignature.jpg|thumb|right|250px|w:John Hancock|John Hancock\u0027s signature on the w:United States Declaration of Independence|United States Declaration of Independence is famous for its size and its bold paraph.From Middle french (ca. 1400-1600) \u0027paraphe\u0027 \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Autograph of Benjamin Franklin (from Nordisk right|thumb|250px|w:Benjamin Benjamin Franklin\u0027s signature, showing parap\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A flourish made after or below one\u0027s signature, originally to prevent forgery\", \"priority\":2}]}, \"synonyms\":{}}");

	add("paraphasia", "{\"term\":\"paraphasia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|para|phasia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A symptom of aphasia in which the sufferer substitutes a spoken word different from the one intended\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parapherna", "{\"term\":\"parapherna\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woman\u0027s property which was not made a part of her marriage dower but remained her own\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paraphernalia", "{\"term\":\"paraphernalia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"The origin of the word is Ancient greek (to 1453) \u0027παρά\u0027 + \u0027φερνή\u0027 (“things additional to a dowry”). In the propertied classes, a dowry was placed under the control of the husband, while the \u0027paraphernalia\u0027 which she brought with her remained the wife’s property.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Miscellaneous items, especially the set of equipment required for a particular activity; stuff\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He has an impressive collection of bicycling \u0027\u0027paraphernalia\u0027\u0027, but he doesn\u0027t ride very often anymore\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Things a woman owns, apart from her dowry\", \"priority\":3}]}, \"synonyms\":{}}");

	add("paraphimosis", "{\"term\":\"paraphimosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|phimosis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A medical condition where the foreskin becomes trapped behind the glans\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paraphysics", "{\"term\":\"paraphysics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|para|physics|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of paranormal activity and the occult as it applies to physical phenomena\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paraplegin", "{\"term\":\"paraplegin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A metalloprotease associated with paraplegia\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parapophysis", "{\"term\":\"parapophysis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|apophysis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ventral transverse, or capitular, process of a vertebra\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parapositronium", "{\"term\":\"parapositronium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Used attributively to describe the state of a positronium exotic atom in which the positron and electron have antiparallel spins\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parapox", "{\"term\":\"parapox\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A disease caused by a parapoxvirus; found chiefly in cows, sheep, goats, and squirrel\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parapraxis", "{\"term\":\"parapraxis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a mistake, such as a slip of the tongue, that reveals a concealed thought or motive\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paraprotaspis", "{\"term\":\"paraprotaspis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|protaspis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The third and last molt stage of the protaspis\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paraprotein", "{\"term\":\"paraprotein\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|protein|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A protein found in the blood only as a result of disease\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parapsychology", "{\"term\":\"parapsychology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027para-\u0027 (after paranormal) + \u0027psychology\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of that which cannot yet be explained; psychic or occult phenomena, such as telepathy and ghosts\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paraquinone", "{\"term\":\"paraquinone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|quinone|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1,4-benzoquinone\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parareligion", "{\"term\":\"parareligion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|religion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A secular belief system having certain aspects of religion\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pararhyme", "{\"term\":\"pararhyme\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|rhyme|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A verse form in which the consonants of two words are the identical (in sound), but the vowels of the words are different\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parasang", "{\"term\":\"parasang\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Persian\", \"ancient greek (to 1453)\", \"Latin\", \"pahlavi\", \"old persian (ca. 600-400 b.c.)\"], \"text\":\"From Latin \u0027parasanga\u0027 from Ancient greek (to 1453) \u0027παρασάγγης\u0027 from unattested Old persian (ca. 600-400 b.c.) (indigenously attested only in w:Middle Iranian languages|Middle Iranian onwards); compare Pahlavi \u0027plsng|tr\u003dfrasang\u0027 (frasang (4 roman miles)) (\u0026gt; Persian \u0027فرسنگ\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A historical w:Iranian Iranian unit of itinerant distance used throughout the Western Mediterranean and the Middle East in antiquity. Functionally comparable to the w:League European league, and presumed to have varied between two and four miles\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"New York Review of Books, 2001, p.66\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To see so much difference betwixt words and deeds, so many \u0027\u0027parasangs\u0027\u0027 betwixt tongue and heart\u0026amp;nbsp;[…\", \"priority\":3}]}, \"synonyms\":{}}");

	add("parascience", "{\"term\":\"parascience\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|science|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Science that is non-mainstream or carried out in a subsidiary capacity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parasite", "{\"term\":\"parasite\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027parasite\u0027 from Latin \u0027parasitus\u0027 from Ancient greek (to 1453) \u0027παράσιτος\u0027 (person who eats at the table of another) from noun use of adjective meaning \u0026quot;feeding beside\u0026quot;, from \u0027παρά\u0027 (beside) + \u0027σῖτος\u0027 (food)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who lives on other people\u0027s efforts or expense and gives little or nothing back\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"an organism that lives on or in another organism, deriving benefit from living on or in that other organism, while not contributing towards that other organism sufficiently to cover the cost to that other organism\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Lice, fleas, ticks and mites are widely spread \u0027\u0027parasites\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A climbing plant which is supported by a wall, trellis etc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1813\u0027\u0027, \u0027Queen Mab\u0027, I\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Her golden tresses shade / The bosom’s stainless pride, / Curling like tendrils of the \u0027\u0027parasite\u0027\u0027 / Around a marble column\", \"priority\":6}]}, \"synonyms\":{}}");

	add("parasiticide", "{\"term\":\"parasiticide\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|parasite|cide|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any substance used to kill parasites\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parasitoid", "{\"term\":\"parasitoid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|parasite|oid|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any organism that is parasitic during part of its life cycle, especially one that eventually kills its host\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parasitology", "{\"term\":\"parasitology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A study of parasites\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paraskiing", "{\"term\":\"paraskiing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|lang\u003den|para|skiing}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a winter sport for handicapped people, a variant of skiing adapted for the disabled\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a winter sport, a combination of paragliding and skiing\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parasol", "{\"term\":\"parasol\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Italian\"], \"text\":\"From French \u0027parasol\u0027 from Italian \u0027parasole\u0027 from {{prefix|para|t1\u003dto shield|sole|t2\u003dsun|lang\u003dit|nocat\u003d1}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small light umbrella used as protection from the sun\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parastatal", "{\"term\":\"parastatal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|para|statal|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A company, agency, or intergovernmental organization, that possesses political clout and is separate from the government, but whose activities serve the state, either directly or indirectly\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parastatistics", "{\"term\":\"parastatistics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|statistics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several proposed statistics that are alternatives to the standard ones\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parasynonym", "{\"term\":\"parasynonym\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|para|synonym|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word or phrase that shares similar meanings with another term in some contexts, but not all; a close synonym\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parataxis", "{\"term\":\"parataxis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{prefix|para|taxis|lang\u003den}}From Ancient greek (to 1453) \u0027παράταξις\u0027 (placement side by side) from \u0027παρα-\u0027 + \u0027τάξις\u0027 (taxis)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Speech or writing in which clauses or phrases are placed together without being separated by conjunctions, for example \u0026quot;I came; I saw; I conquered\u0026quot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The juxtaposition of two images or fragments, usually starkly dissimilar, without a clear connection\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A coalition or \u0026quot;partisan camp\u0026quot; in the Ancient Greek political system\", \"priority\":3}]}, \"synonyms\":{}}");

	add("paratext", "{\"term\":\"paratext\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|text|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In literary theory, meanings that are alluded to, above or beyond the printed text; interpretations of text\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paratheater", "{\"term\":\"paratheater\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|theater|lang\u003den}}, coined by {{w|Jerzy Grotowski}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A kind of experimental theater in which the audience directly participates\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parathion", "{\"term\":\"parathion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"O,O-Diethyl-O-4-nitro-phenylthiophosphate\u0027\u0027, a powerful, dangerously toxic insecticide\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parathyroidectomy", "{\"term\":\"parathyroidectomy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|parathyroid|ectomy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The procedure to remove one or more of the parathyroid glands\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paratransgenetics", "{\"term\":\"paratransgenetics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of transgenics in which the bacteria within the digestive tract of the target organism are genetically modified\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paratransit", "{\"term\":\"paratransit\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|para|transit|gloss1\u003dbeside|lang\u003den}}, perhaps influenced by \u0027paraplegia\u0027 US from 1972.\u0026lt;ref\u0026gt;\u0027\u00271980\u0027\u0027, Australian Bureau of Transport Economics, South Australian Department of Transport, \u0027Paratransit: Changing Perceptions of Public Transport : Proceedings of a Workshop Held in Mount Gambier, 20-23 February 1979\u0027, [http://books.google.com.au/books?id\u003dkjRWAAAAMAAJ\u0026amp;q\u003d%22paratransit%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22paratransit%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003duvGPT5HFHKahmQX5ubCBAg\u0026amp;redir_esc\u003dy page 37] — The term ‘\u0027\u0027paratransit\u0027\u0027’ was first used in the US by the federal Department of Transportation (DOT) in a request for research proposals issued in 1972.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An auxiliary transit service without fixed routes or schedules, usually serving the disabled on demand\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Marco Bristo, \u0027Promises to Keep: A Decade of Federal Enforcement of the Americans with Disabilities Act\u0027, [http://books.google.com.au/books?id\u003deoLTV48le48C\u0026amp;pg\u003dPA279\u0026amp;dq\u003d%22paratransit%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dTviPT4ufFomimQW9rLjnAQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22paratransit%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 279\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The disability community had hoped that the submission of ADA complementary \u0027\u0027paratransit\u0027\u0027 plans to FTA would constitute an opportunity for real monitoring of local progress and that FTA would take action to ensure that transit agencies were in compliance with their plans\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"through Access-a-Ride , the city’s door-to-door \u0027\u0027paratransit\u0027\u0027 service for the elderly and the disabled\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Kenneth Button, \u0027A Dictionary of Transport Analysis\u0027, [http://books.google.com.au/books?id\u003dhBSrKGs2UC4C\u0026amp;pg\u003dPA295\u0026amp;dq\u003d%22paratransit%22+-intitle:%22paratransit%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dfP6PT7zFH4T5mAWlkf3bAQ\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22paratransit%22%20-intitle%3A%22paratransit%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 295\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In developing countries the form of \u0027\u0027paratransit\u0027\u0027 modes range from simple non-motorized human, mainly hand-drawn or pedal-driven, or animal-powered vehicles to motorized minibuses\", \"priority\":8}]}, \"synonyms\":{}}");

	add("parcel", "{\"term\":\"parcel\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027parcelle\u0027 (a small piece or part, a parcel, a particle) from \u0027\u0027 contr. \u0027parcella\u0027 () dim. of Latin \u0027particula\u0027 (particle) diminutive of \u0027pars\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A package wrapped for shipment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"At twilight in the summerthe mice come out. Theyeat the luncheon crumbs. Mr. Checkly, for instance, always brought his dinner in a paper \u0027\u0027parcel\u0027\u0027 in his coat-tail pocket, and ate it when so disposed, sprinkling crumbs lavishlyon the floor\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An individual consignment of cargo for shipment, regardless of size and form\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A division of land bought and sold as a unit\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A group of birds\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An indiscriminate or indefinite number, measure, or quantity; a collection; a group\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"c.1564–1616\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"This youthful \u0027\u0027parcel\u0027\u0027 / Of noble bachelors stand at my disposing\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027parcel\u0027\u0027 of giddy creatures of her own age\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A small amount of food that has been wrapped up, for example a pastry\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A portion of anything taken separately; a fragment of a whole; a part\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1667-1735\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"two \u0027\u0027parcels\u0027\u0027 of the white of an eg\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1840–1893\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027parcels\u0027\u0027 of the nation adopted different forms of self-government\", \"priority\":15}]}, \"synonyms\":{}}");

	add("parclo", "{\"term\":\"parclo\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Shortening of partial cloverleaf interchange{{blend|partial|cloverleaf|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A partial cloverleaf interchange\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parclose", "{\"term\":\"parclose\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027parclos\u0027 \u0027perclose\u0027 et al., Middle french (ca. 1400-1600) \u0027parclose\u0027 (end, enclosure) noun use of past participle of \u0027parclore\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A partition that closes off part of a building; especially one that separates an altar or chapel from the rest of a church\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An enclosed area, especially one separated from the main body of a building by a screen or partition\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thenne syr Percyual aspyed that therin was a man or a woman / for the vysage was couerd / thenne he left of his lokyng and herd his seruyse / And whan hit came to the sacrynge / he that lay within that \u0027\u0027Percloos\u0027\u0027 dressid hym vp and vncouerd his heede / and thenne hym besemed a passynge old man / and he had a crowne of gold vpon his hede\u0026lt;!--Prior quote:he that lay within the \u0027\u0027perclose\u0027\u0027 dressyd hym up and uncoverde hys hede; and than hym besemed a passyng olde man, and he had a crowne of golde uppon hys hede--\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pardon", "{\"term\":\"pardon\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"old french (842-ca. 1400)\", \"Proto-Germanic\", \"old high german (ca. 750-1050)\"], \"text\":\"From Middle english (1100-1500) \u0027pardone. Middle English|pardonen\u0027 from Old french (842-ca. 1400) {{m|fro|pardoner}} (modern French {{m|fr|pardonner}}), from {{m|la|*perdonare}}, from \u0027per-\u0027 + \u0027donare\u0027 a loan-translation of a Proto-germanic word represented by Frankish {{m|frk|*firgeban||to forgive, give up completely}}, from \u0027fir-\u0027 + \u0027geban\u0027 Akin to Old high german (ca. 750-1050) \u0027fargeba. Old High German|fargeban,\u0027 \u0027firgeban\u0027 (to forgive) Old english (ca. 450-1100) {{m|ang|forġiefan||to forgive}}. More at forgiv. English|forgive.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Forgiveness for an offence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1748\u0027\u0027: Samuel Richardson, \u0027Clarissa\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a step, that could not be taken with the least hope of ever obtaining \u0027\u0027pardon\u0027\u0027 from or reconciliation with any of my friends\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An order that releases a convicted criminal without further punishment, prevents future punishment, or (in some jurisdictions) removes an offence from a person\u0027s criminal record, as if it had never been committed\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027: President Gerald Ford, \u0027Proclamation 4311\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I... have granted and by these presents do grant a full, free, and absolute \u0027\u0027pardon\u0027\u0027 unto Richard Nixon for all offenses against the United States\", \"priority\":6}]}, \"synonyms\":{}}");

	add("pardoner", "{\"term\":\"pardoner\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|pardon}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who pardons\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In medieval Catholicism, a person licensed to grant papal pardons or indulgences\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"c. 1390\u0027\u0027: Geoffrey Chaucer, \u0027The Canterbury Tales\u0027 (Prologue\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"With him there rode a gentle \u0027\u0027pardonere\u0027\u0027 / Of Ronceval, his friend and his compere, / That straight was comen from the court of Rome\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1820\u0027\u0027, Sir Walter Scott, \u0027The Abbot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"old men, cheated by their wives and daughters, pillaged by their sons, and imposed on by their domestics, a braggadocia captain, a knavish \u0027\u0027pardoner\u0027\u0027 or quaestionary, a country bumpkin and a wanton city dame\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1917\u0027\u0027, \u0027Catholic Encyclopedia\u0027, \u0026quot;Collections\u0026quot; [http://www.newadvent.org/cathen/04104b.htm\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"These grants of Indulgence were often entrusted to preachers of note (\u0026quot;Pardoners\u0026quot;) who carried them from town to town, collecting money and using their eloquence to recommend the good work in question and to enhance the spiritual privileges attached to it\", \"priority\":8}]}, \"synonyms\":{}}");

	add("paregoric", "{\"term\":\"paregoric\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Late Latin \u0027paregoricus\u0027, from Greek παρηγοριχος ‘encouraging, soothing’, from παρηγορειν ‘console, soothe’.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a painkiller; a medicine which soothes or relieves pai\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027: My local doctor promises to accompany me ashore, spare no expense to obtain powerful \u0027\u0027paregorics\u0027\u0027 \u0026amp; remain at my bedside until my recovery is compleat, even if Prophetess must leave for California without us. — David Mitchell, \u0027Cloud Atlas\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pareidolia", "{\"term\":\"pareidolia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027παρα\u0027 (concurrent, alongside) + \u0027εἴδωλον\u0027 (image)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The tendency to interpret a vague stimulus as something known to the observer, such as interpreting marks on Mars as canals, seeing shapes in clouds, or hearing hidden messages in music\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Raymond Moody, with Paul Perry, \u0027Reunions: Visionary encounters with departed loved ones\u0027, page 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Pareidolia\u0027\u0027 underlies several forms of divination\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Steve W. Martin, \u0027Heavy Hitter Selling: How Successful Salespeople Use Language and Intuition to Persuade Customers to Buy\u0027, [http://books.google.com/books?id\u003d99Rqq5yTBIAC\u0026amp;pg\u003dPA150\u0026amp;dq\u003d%22pareidolias%22+-intitle:pareidolia\u0026amp;hl\u003den\u0026amp;ei\u003digYYTs2yIsWNmQX7v4Qi\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d5\u0026amp;ved\u003d0CDwQ6AEwB\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pareidolias%22%20-intitle%3Apareidolia\u0026amp;f\u003dfalse page 150\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Pareidolias\u0027\u0027 aren\u0027t solely limited to images. When I was a youngster, I remember listening to The Beatles\u0027 song \u0026quot;Strawberry Fields\u0026quot; over and over to hear what seemed to be \u0026quot;I buried Paul.\u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Rick Emmer, \u0027Loch Ness Monster: Fact Or Fiction?\u0027, page 8\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The most famous example of \u0027\u0027pareidolia\u0027\u0027 is the familiar face of the Man in the Moon\", \"priority\":8}]}, \"synonyms\":{}}");

	add("paremiologist", "{\"term\":\"paremiologist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|paremiology|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who studies proverbs\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paremiology", "{\"term\":\"paremiology\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From the obsolete \u0027paroemia\u0027 (proverb) \u0027paremia\u0027 + \u0027-ology\u0027 from Latin \u0027paroemia\u0027 from Ancient greek (to 1453) \u0027παροιμία\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of proverbs\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parenchyma", "{\"term\":\"parenchyma\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027παρέγχυμα\u0027 (anything poured in beside) from παρά \u0027alongside\u0027 + -enchyma.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The functional part of an organ, as opposed to supporting tissue\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The ground tissue making up most of the non-woody parts of a plant\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parent", "{\"term\":\"parent\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) {{m|enm|parent}}, from Anglo-norman {{m|fro|parent}}, Middle french (ca. 1400-1600) {{m|frm|parent}}, from Latin {{m|la|parentem}}, accusative of {{m|la|parēns||parent}}, present participle of {{m|la|parere||to breed, bring forth}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the two persons from whom one is immediately biologically descended; a mother or father\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"My twin sister says she loves our \u0027\u0027parents\u0027\u0027, but honestly, I dislike them\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"c. 1595\u0027\u0027, \u0027The Tempest\u0027, First Folio 1623, I.2\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"my trust / Like a good \u0027\u0027parent\u0027\u0027, did beget of him / A falsehood in it\u0027s contrarie, as great / As my trust was, which had indeede no limit, / A confidence sans bound\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And they asked them, saying, Is this your son, who ye say was born blind? how then doth he now see? His \u0027\u0027parents\u0027\u0027 answered them and said, We know that this is our son, and that he was born blind\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Siobhan O\u0027Neill, \u0027The Guardian\u0027, 24 Aug 2005\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The NHS is naturally pro-immunisation, reassuring \u0027\u0027parents\u0027\u0027 that their babies can easily cope with these jabs\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A surrogate mothe\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A third person who has provided DNA samples in a IVF procedure in order to alter faulty genetic materia\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A person who acts as a parent in rearing a child; a step-parent or adoptive parent\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d26|page\u003d19|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/2013/may/27/globalisation-is-about-taxes-too Globalisation is about taxes passage\u003dIt is time the international community faced the reality: we have an unmanageable, unfair, distortionary global tax regime. [\u0026amp;hellip;] It is the starving of the public sector which has been pivotal in America no longer being the land of opportunity – with a child\u0027s life prospects more dependent on the income and education of its \u0027\u0027parents\u0027\u0027 than in other advanced countries\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A relative\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The source or origin of something\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1785\u0027\u0027, \u0027Notes on the State of Virginia\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Misery is often the \u0027\u0027parent\u0027\u0027 of the most affecting touches in poetry\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"An organism from which a plant or animal is immediately biologically descended\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Sponsor, supporter, owner, protector. \u0026lt;ref name\u003dCOED2\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[https://openlibrary.org/works/OL10563347W The Three Corpse section\u003dchapter passage\u003dThe dinghy was trailing astern at the end of its painter, and Merrion looked at it as he passed. He saw that it was a battered-looking affair of the prahm type, with a blunt snout, and like the \u0027\u0027parent\u0027\u0027 ship, had recently been painted a vivid green\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A parent company\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21579860-g8-pledges-tackle-three-ts-t-time T passage\u003dThe ability to shift profits to low-tax countries by locating intellectual property in themis often assumed to be the preserve of high-tech companies.current tax rules make it easy for all sorts of firms to generate“stateless income”: profit subject to tax in a jurisdiction that is neither the location of the factors of production that generate the income nor where the \u0027\u0027parent\u0027\u0027 firm is domiciled\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"The object from which a child or derived object is descended; a node superior to another node\", \"priority\":21}]}, \"synonyms\":{}}");

	add("parenthesis", "{\"term\":\"parenthesis\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027parenthesis\u0027 (addition of a letter to a syllable in a word) from Ancient greek (to 1453) \u0027παρένθεσις\u0027 from \u0027παρεντίθημι\u0027 (i put in beside, mix up) from \u0027παρά\u0027 (beside) + \u0027ἐν\u0027 (in) + \u0027τίθημι\u0027 (put, place) (from Proto-Indo-European base {{m|ine-pro|*dhe-||to put, to do}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A clause, phrase or word which is inserted (usually for explanation or amplification) into a passage which is already grammatically complete, and usually marked off with brackets, commas or dashes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Either of a pair of brackets, especially round brackets, \u0027\u0027(\u0027\u0027 and \u0027\u0027)\u0027\u0027 (used to enclose parenthetical material in a text\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A digression; the use of such digressions\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027w:Up in the Air (2009 Up in the air\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Ryan Bingham\u0027: I thought I was a part of your life. \u0027Alex Goran\u0027: I thought we signed up for the same thing... I thought our relationship was perfectly clear. You are an escape. You\u0027re a break from our normal lives. You\u0027re a \u0027\u0027parenthesis\u0027\u0027. \u0027Ryan Bingham\u0027: I\u0027m a parenthesis\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Such brackets as used to clarify expressions by grouping those terms affected by a common operator, or to enclose the components of a vector or the elements of a matrix\", \"priority\":6}]}, \"synonyms\":{}}");

	add("parenthood", "{\"term\":\"parenthood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|parent|hood|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being a parent\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parents", "{\"term\":\"parents\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"I like hanging out with my \u0027\u0027parents\u0027\u0027, but my friends think it\u0027s weird\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paresis", "{\"term\":\"paresis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Modern Latin, from Ancient greek (to 1453) \u0027πάρεσις\u0027 (letting go, paralysis) from \u0027παριέναι\u0027 (relax) from \u0027παρα-\u0027 + \u0027ἰέναι\u0027 (let go)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A paralysis which is incomplete or which occurs in isolated areas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Inflammation of the brain as a cause of dementia or paralysis\", \"priority\":2}]}, \"synonyms\":{}}");

	add("paresthesis", "{\"term\":\"paresthesis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027παραίσθησις\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Paresthesia\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parhelion", "{\"term\":\"parhelion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027parelion\u0027 from Ancient greek (to 1453) \u0027παρήλιον\u0027 from \u0027παρά\u0027 + \u0027ἥλιος\u0027 (sun)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bright spot in the sky due to the refraction of the sun’s image by ice crystals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a reflection or imag\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1962\u0027\u0027, \u0027Pale Fire\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The short (166 lines) Canto One, with all those amusing birds and \u0027\u0027parhelia\u0027\u0027, occupies thirteen cards\", \"priority\":4}]}, \"synonyms\":{}}");

	add("pariah", "{\"term\":\"pariah\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Malayalam\", \"Tamil\"], \"text\":\"From Tamil {{m|ta|பறையர்}},from {{m|ta|sc\u003dTaml|பறையன்||drummer}}, from {{m|ta|sc\u003dTaml|பறை||drum}} or from Malayalam {{m|ml|പറയർ}}, from {{m|ml|പറയൻ||drummer}}, from {{m|ml|പറ||drum}}. \u0027Parai\u0027 in Tamil or \u0027Para\u0027 in Malayalam refers to a type of large drum designed to announce the king’s notices to the public. The people who made a living using the \u0027parai\u0027 were called \u0027paraiyar\u0027; in the caste-ridden society they were in the lower strata, hence the derisive \u0027paraiah\u0027 and \u0027pariah\u0027. Now the term is used to describe an outcast in English.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An outcast\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A demographic group, species, or community that is generally despised\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Someone in exile\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A member of one of the oppressed social castes in India\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person who is rejected (from society or home\", \"priority\":5}]}, \"synonyms\":{}}");

	add("parietin", "{\"term\":\"parietin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The predominant cortical pigment of some lichens, also found in roots of curled dock (\u0027Rumex crispus\u0027), having an orange-yellow colour and antifungal properties\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parisian", "{\"term\":\"parisian\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027parisien\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who was born in, or is a citizen or inhabitant of, Paris, France\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parisienne", "{\"term\":\"parisienne\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|Parisienne|lang\u003den}}, feminine of {{m|fr|Parisien}}, from {{m|fr|Paris}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female from Paris\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027, translated from Honoré de Balzac\u0027s \u0027The Works of Honoré de Balzac\u0027, page 157\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It is so natural to a \u0027\u0027Parisienne\u0027\u0027, even when passion has almost mastered her, to hesitate and pause before taking the plunge\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Lisa Tierstan, \u0027Marianne in the Market\u0027 (California 2001), page 122\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Proclaiming taste to be a learned as much as an inborn trait, they sought to establish themselves as aesthetic educators of the vulnerable, unschooled \u0027\u0027Parisienne\", \"priority\":5}]}, \"synonyms\":{}}");

	add("parison", "{\"term\":\"parison\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027paraison\u0027, from \u0027parer\u0027 ‘pare’.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A spherical mass of glass, rolled immediately after being taken out of the furnace\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Thomas Pynchon, \u0027Against the Day\u0027 (Vintage 2007), page 278\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The wineglasses were from a matched dozen, each having begun as a glowing \u0027\u0027parison\u0027\u0027 at the end of some blowpipe over in Murano but days before\", \"priority\":3}]}, \"synonyms\":{}}");

	add("parker", "{\"term\":\"parker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"for a gamekeeper\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"transferred from the surname\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parking", "{\"term\":\"parking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"See \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The action of the verb \u0027\u0027to park\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Parking\u0027\u0027 in central London can be very difficult\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Space in which to park a car or other vehicle\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It can be difficult to find \u0027\u0027parking\u0027\u0027 in central London\", \"priority\":4}]}, \"synonyms\":{}}");

	add("parkland", "{\"term\":\"parkland\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|park|land|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Land suitable for use as a park\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parklet", "{\"term\":\"parklet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|park|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A parking space sized area used for recreational or beautification purposes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Lisa P. White, Contra Costa Times, \u0027Martinez council to review outdoor dining proposal next month\u0027, [http://www.mercurynews.com/breaking-news/ci_20470362/martinez-council-review-outdoor-dining-proposal-next-month link\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Bison system has been used for \u0027\u0027parklets\u0027\u0027 in San Francisco and New York City\", \"priority\":3}]}, \"synonyms\":{}}");

	add("parkour", "{\"term\":\"parkour\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027parkour\u0027 altered spelling of \u0027parcours\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An athletic discipline, in which practitioners traverse any environment in the most efficient way possible using their physical abilities, and which commonly involves running, jumping, vaulting, rolling, and other similar physical movements\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parlance", "{\"term\":\"parlance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027parlance\u0027 \u0027\u0027 from \u0027parler\u0027 () + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A certain way of speaking, of using words, especially when it comes to those with a particular job or interest\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Speech, discussion or debate\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parley", "{\"term\":\"parley\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027parler\u0027 (to talk; to speak) from {{m|la|*paraulare||to speak}}, from \u0027parabolare\u0027 from Latin \u0027parabola\u0027 (comparison) from Ancient greek (to 1453) \u0027παραβολή\u0027 from \u0027παρά|sc\u003dpolytonic\u0027 (beside) with \u0027βολή|sc\u003dpolytonic\u0027 (throwing)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A conference, especially one between enemies\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We yield on \u0027\u0027parley\u0027\u0027, but are stormed in vain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, w:Peter B. Peter B. Kyne, \u0027The Understanding Heart\u0027, Chapter I\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Without further \u0027\u0027parley\u0027\u0027 Garland rode off up the hog\u0027s-back and the sheriff rode off down it …\", \"priority\":4}]}, \"synonyms\":{}}");

	add("parliament", "{\"term\":\"parliament\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From \u0027parlamentum\u0027 and its sources, Anglo-norman and Old french (842-ca. 1400) \u0027parlement\u0027 (discussion, meeting, assembly, council) from \u0027parler\u0027 (to speak) and \u0027-ment\u0027 from Latin \u0027-mentum\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Meanings relating to a political body authorized to exercise governmental powers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An institution whose elected or appointed members meet to debate the major political issues of the day and usually to exercise legislative powers and sometimes judicial powers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"date\u003d14 December passage\u003dThe row started over who will run for \u0027\u0027parliament\u0027\u0027 in a wealthy rightwing constituency on the left bank in Paris, a safe seat for Sarkozy\u0027s ruling UMP. Dati is already a local mayor in the neighbourhood, a job felt to have been handed to her on a plate when she was a Sarkozy favourite. She has since fallen from grace, and when she left government she took a European parliament seat, considered a consolation prize\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A group of representatives of the people elected or appointed to serve as a parliament \u0027(in sense 1 above)\u0027 for a certain period of time. In this sense the word is commonly used with an ordinal number (for example, \u0027first parliament\u0027 and \u002712th parliament\u0027) or a descriptive adjective (for example, \u0027\u0027, \u0027\u0027 and\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Following the general election, Jane Doe took her oath of office as a member of the nation\u0027s fifth \u0027\u0027parliament\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"book title\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"out of doors, and commenced a new military government, by means of a committee of officers, called the Council of Safety\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A collective noun for a flock of owls or rooks\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"parliament Parliament cake; a type of gingerbread\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1869\u0027\u0027, RD Blackmoore, \u0027Lorna Doone\u0027, Chapter II\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A certain boy leaning up against me would not allow my elbow room, and struck me very sadly in the stomach part, though his own was full of my \u0027\u0027parliament\", \"priority\":11}]}, \"synonyms\":{}}");

	add("parliamentarian", "{\"term\":\"parliamentarian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|parliamentary|an|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of a parliament, congress or an elected national legislative body of another name\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person well-versed in parliamentary procedure\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An officer in most legislative bodies charged with being well-versed in the parliamentary rules of that legislative house, and whose rulings are taken as authoritative, to be appealed only to the whole of the house itself under special rules\", \"priority\":3}]}, \"synonyms\":{}}");

	add("parlor", "{\"term\":\"parlor\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"French\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027parlur\u0027 and Old french (842-ca. 1400) \u0027parleor\u0027 from the verb \u0027parler\u0027 (to speak) \u0026lt;!-- or Old english (ca. 450-1100) \u0027parlour, parlur\u0027, French \u0027parloir\u0027, \u0027parlatorium\u0027. ? --\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The living room of a house, or a room for entertaining guests; a room for talking\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dSo, after a spell, he decided to make the best of it and shoved us into the front \u0027\u0027parlor\u0027\u0027. \u0027Twas a dismal sort of place, with hair wreaths, and wax fruit, and tin lambrekins, and land knows what all\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The apartment in a monastery or nunnery where the residents are permitted to meet and converse with each other or with visitors from the outside\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A room for lounging; a sitting-room; a drawing room\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A comfortable room in a public house\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A covered open-air patio\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A shop or other business selling goods specified by context\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A shed used for milking cattle\", \"priority\":8}]}, \"synonyms\":{}}");

	add("parma", "{\"term\":\"parma\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\", \"Latin\"], \"text\":\"From Italian {{m|it|Parma}}, from Latin {{m|la|Parma}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Province of Emilia-Romagna, Italy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A city, the capital of Parma\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parnassianism", "{\"term\":\"parnassianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Parnassian|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A French literary style which began during the positivist period of the 19th century\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parnellite", "{\"term\":\"parnellite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Parnell|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the adherents of (1846-1891) in his advocacy of home rule for Ireland\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parody", "{\"term\":\"parody\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027lang\u003dla\u0027 from Ancient greek (to 1453) \u0027lang\u003dgrc|παρῳδία\u0027 () from \u0027lang\u003dgrc|παρά\u0027 () + \u0027ᾠδή\u0027 (song)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A work or performance that imitates another work or performance with ridicule or irony\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The lively \u0027\u0027parody\u0027\u0027 which he wrote was received with great applause\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A popular maxim, adage, or proverb\", \"priority\":4}]}, \"synonyms\":{}}");

	add("parole", "{\"term\":\"parole\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027parole\u0027 (lang\u003dfro) from \u0027parabola\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The release or state of a former prisoner on the understanding that he/she checks in regularly and obeys the law\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He will be on \u0027\u0027parole\u0027\u0027 for nearly two more years\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He was released on \u0027\u0027parole\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The defendant shall be sentenced to life without the possibility of \u0027\u0027parole\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The amount of time a former prisoner spends on limited release\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A word of honor, especially given by a prisoner of war, to not engage in combat if released\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"This man had forfeited his military \u0027\u0027parole\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Language in use, as opposed to language as a system\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The permission for foreigner who does not meet the technical requirements for a visa to be allowed to enter the U.S. on humanitarian grounds\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A watchword given only to officers of guards; distinguished from the countersign, which is given to all guards\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"An oral declaration; see\", \"priority\":12}]}, \"synonyms\":{}}");

	add("paronomasia", "{\"term\":\"paronomasia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027paronomasia\u0027 from Ancient greek (to 1453) \u0027παρονομασία\u0027 (play upon words which sound alike) from \u0027παρα-\u0027 () + \u0027ὀνομασία\u0027 (naming)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pun or play on word\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, Anthony Burgess, \u0027Enderby\u0027s Dark Lady\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"he gloomily regarded his new digital watch, faintly fascinated by the onward march of the square figures which turned one into the other with insolent ease, a kind of numerical \u0027\u0027paronomasia\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Thomas Pynchon, \u0027Mason \u0026amp; Dixon\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Ev’rywhere but at Norfolk, where talk of Passion far outweighs its Enactment,– indeed, the Sailors’ \u0027\u0027Paronomasia\u0027\u0027 for that wretched Place, is ‘No-Fuck’\", \"priority\":5}]}, \"synonyms\":{}}");

	add("parovarium", "{\"term\":\"parovarium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|ovarium|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group of tubules, a remnant of the Wolffian body, often found near the ovary or oviduct\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paroxetine", "{\"term\":\"paroxetine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an antidepressant drug, Paxil\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paroxysm", "{\"term\":\"paroxysm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027lang\u003dfr\u0027 from \u0027lang\u003dla\u0027 from Ancient greek (to 1453) \u0027lang\u003dgrc|παροξυσμός\u0027 () from \u0027lang\u003dgrc|παροξύνειν\u0027 () from \u0027lang\u003dgrc|παρά\u0027 () + \u0027lang\u003dgrc|ὀξύνειν\u0027 () from \u0027lang\u003dgrc|ὀξύς\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A random or sudden outburst (of activity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Unable to turn his back on the fanged danger and go on, the bull would be driven into \u0027\u0027paroxysms\u0027\u0027 of rage\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dThe slightest effort made the patient cough. He would stand leaning on a stick and holding a hand to his side, and when the \u0027\u0027paroxysm\u0027\u0027 had passed it left him shaking\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"«There, on the soft sand, a few feet away from our elders, we would sprawl all morning, in a petrified \u0027\u0027paroxysm\u0027\u0027 of desire, and take advantage of every blessed quirk in space and time to touch each other\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, \u0027Mantissa\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Indeed in his excitement at this breakthrough he inadvertently dug his nails into the nurse\u0027s bottom, a gesture she misinterpreted, so that he had to suffer a \u0027\u0027paroxysm\u0027\u0027 of breasts and loins in response\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An explosive event during a volcanic eruption\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A sudden recurrence of a disease\", \"priority\":8}]}, \"synonyms\":{}}");

	add("paroxytonesis", "{\"term\":\"paroxytonesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being paroxytone\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parquet", "{\"term\":\"parquet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A wooden floor made of parquetry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d“Piracy”: A Romantic Chronicle of These chapter\u003d1/1/3|url\u003dhttp://openlibrary.org/works/OL1519647W|passage\u003dThat large room had always awed Ivor: even as a child he had never wanted to play in it, for all that it was so limitless, the \u0027\u0027parquet\u0027\u0027 floor so vast and shiny and unencumbered, the windows so wide and light with the fairy expanse of Kensington Gardens\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe huge square box, \u0027\u0027parquet\u0027\u0027-floored and high-ceilinged, had been arranged to display a suite of bedroom furniture designed and made in the halcyon days of the last quarter of the nineteenth century,\u0026amp;nbsp;[\u0026amp;hellip\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The part of a theatre between the orchestra and the parquet circle\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In some European countries, the branch of the administrative government that handles prosecutions\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In some European bourses or stock exchanges, the railed-in space within which the \u0027agents de change\u0027, or privileged brokers, conduct business; also, the business conducted by them, distinguished from the coulisse, or outside market\", \"priority\":6}]}, \"synonyms\":{}}");

	add("parry", "{\"term\":\"parry\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"French\", \"old french (842-ca. 1400)\"], \"text\":\"From earlier \u0027parree\u0027 from Middle english (1100-1500) {{m|enm|*parree}}, {{m|enm|*paree}}, from Old french (842-ca. 1400) \u0027paree\u0027 (preparation, ceremony, parade) from \u0027parāta\u0027 (preparation, parade) from \u0027parāre\u0027 (to ward off, guard, defend, prepare, get ready) More at {{l|en|pare}}. The English verb \u0027to parry\u0027 is taken from the noun.Alternative etymology derives the verb \u0027parry\u0027 from French \u0027parez !\u0027 the imperative form of \u0027parer\u0027 (to fend off) ultimately from the \u0027parāre\u0027 See above.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A defensive or deflective action; an act of parrying\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A simple defensive action designed to deflect an attack, performed with the forte of the blade\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parranda", "{\"term\":\"parranda\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"Borrowed from Spanish \u0027parranda\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Venezuelan genre of music with African influences and drumming\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parrhesia", "{\"term\":\"parrhesia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027παρρησία\u0027 from \u0027πᾶν\u0027 (all) (English \u0027pan-\u0027 + \u0027ῥῆσις\u0027 \u0027ῥῆμα\u0027 (utterance, speech)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"boldness or freedom in speech; the seeking of forgiveness for such speech\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parricide", "{\"term\":\"parricide\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027parricide\u0027 from Latin \u0027parricida\u0027 of uncertain origin. Equivalent to {{suffix||cide|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who kills a relative, especially a parent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1605\u0027\u0027, William Shakespeare, \u0027King Lear\u0027 II.i\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I told him the reuenging Gods, / ’Gainst \u0027\u0027Paricides\u0027\u0027 did all the thunder bend\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Someone who commits treason\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The killing of a relative, especially a parent\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The killing of a ruler, or other authority figure; treason.Category:en:Death\", \"priority\":6}]}, \"synonyms\":{}}");

	add("parrot", "{\"term\":\"parrot\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"First attested in 1525. From Middle french (ca. 1400-1600) {{m|frm|perrot}}, either a diminutive of {{m|frm|Pierre}} or a shortened form of {{m|frm|perroquet}}. Compare French {{m|fr|pierrot}} and Occitan {{m|oc|parrat}}. A number of origins have been suggested for {{m|fr|perroquet}}, such as Spanish {{m|es|periquito}} and Italian {{m|it|parrocchetto}}. The relationship between these various words is disputed. Replaced earlier \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A kind of bird, many species of which are colourful and able to mimic human speech, of the order Psittaciformes or (narrowly) of the family Psittacidae\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I bought a wonderful \u0027\u0027parrot\u0027\u0027 at the pet store\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Mrs Merdle was at home, and was in her nest of crimson and gold, with the \u0027\u0027parrot\u0027\u0027 on a neighbouring stem watching her with his head on one side, as if he took her for another splendid \u0027\u0027parrot\u0027\u0027 of a larger species\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A parroter; a person who repeats what was just said\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"What kind of a \u0027\u0027parrot\u0027\u0027 are you? He just said that\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1837\u0027\u0027, w:Ralph Waldo Ralph Waldo Emerson, \u0027s:The American The American Scholar\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In this distribution of functions, the scholar is the delegated intellect. In the right state, he is, \u0027Man Thinking\u0027. In the degenerate state, when the victim of society, he tends to become a mere thinker, or, still worse, the \u0027\u0027parrot\u0027\u0027 of other men’s thinking\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A puffin\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"channel Channel coal\", \"priority\":9}]}, \"synonyms\":{}}");

	add("parrotbill", "{\"term\":\"parrotbill\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|parrot|bill|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a group of warbler-like birds of uncertain taxonomy, native to East East and Southeast Asia, generally small and long-tailed, which inhabit reed beds and similar habitats and feed mainly on seeds\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parrothouse", "{\"term\":\"parrothouse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|parrot|house|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An aviary where parrots and similar exotic birds are kept for display\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027 — w:G. K. G. K. Chesterton, \u0027s:The Spice of Life and Other The Spice of Life and Other Essays\u0027, \u0027The Soul in Every Legend\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I do not deny that the poet may write an ode to a parrot as well as to a skylark; or for that matter a serenade to a penguin or a pelican. But he will prefer the parrot outside the \u0027\u0027parrothouse\u0027\u0027. He will prefer the pelican in the wilderness\", \"priority\":3}]}, \"synonyms\":{}}");

	add("parrotlet", "{\"term\":\"parrotlet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|parrot|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A miniature parrot of the New World of the genera \u0027Forpus\u0027, \u0027Nannopsittaca\u0027 and \u0027Touit\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parser", "{\"term\":\"parser\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|parse|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who parses\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A computer program that parses\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parsimoniousness", "{\"term\":\"parsimoniousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being parsimonious\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parsley", "{\"term\":\"parsley\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027peresil\u0027 from Latin \u0027petroselinum\u0027 (spelt also \u0027petroselinon\u0027 lt;ref\u0026gt;[http://linguaeterna.com/vocabula/show.php?n\u003d33718 the entry] in :w:ru:Дворецкий И. Х.|Dvoretsky\u0027s and :w:ru:Корольков, Дмитрий Николаевич|Korol\u0027kov\u0027s \u0027Latin - Russian dictionary\u0027, the most voluminous Latin dictionary issued in the 20th century\u0026lt;/ref\u0026gt;), from Ancient greek (to 1453) \u0027πετροσέλινον\u0027 (parsley) from \u0027πέτρος\u0027 (rock, stone) + \u0027σέλινον\u0027 (celery)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bright green, biennial herb, \u0027Petroselinum crispum\u0027 or \u0027Petroselinum neapolitanum\u0027 having either flat or curled leaves\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The leaves of this plant used in Middle Eastern, European, and American cooking\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parson", "{\"term\":\"parson\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman from Old french (842-ca. 1400) \u0027persone\u0027 (lang\u003dfro) from \u0027persona\u0027 (lang\u003dla) from Latin \u0027persona\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Anglican cleric having full legal control of a parish under ecclesiastical law; a rector\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A Protestant minister\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parti", "{\"term\":\"parti\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027parti\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone (especially a man) who is considered to be a good choice for marriage, because of wealth, status etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, Bram Stoker, \u0027Dracula\u0027, [http://www.gutenberg.org/files/345/345-h/345-h.htm Chapter 5\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We met some time ago a man that would just do for you, if you were not already engaged to Jonathan. He is an excellent \u0027\u0027\u0027parti\u0027\u0027\u0027, being handsome, well off, and of good birth\", \"priority\":3}]}, \"synonyms\":{}}");

	add("parts", "{\"term\":\"parts\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"intellectual ability or learnin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He was a man of great \u0027\u0027parts\u0027\u0027 but little virtue\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"vicinity, regio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1854\u0027\u0027, Lord Cockburn, \u0027Memoir of Thomas Thomson\u0027, Scotland Bannatyne Club, page 241\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"We intend being at Leamington before long, unless some change in the weather should make our stay in these \u0027\u0027parts\u0027\u0027 more tolerable\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The male genitals\", \"priority\":6}]}, \"synonyms\":{}}");

	add("partage", "{\"term\":\"partage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027partage\u0027 from \u0027partir\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A part, portion or share\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Division, sharing; the act of portioning out or dividing up\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"looke into our Royall house, where so many \u0027\u0027partages\u0027\u0027 [tr. ], so many surnames, and so many severall titles have so encumbred us, that the originall of the stocke is utterly lost\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The one-time standard practice of the divvying up of artifacts between archaeologists, their patrons and the host territory\", \"priority\":4}]}, \"synonyms\":{}}");

	add("parterre", "{\"term\":\"parterre\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"French\"], \"text\":\"French \u0027parterre\u0027 (on the ground) (\u0027par\u0027 (on) + \u0027terre\u0027 (ground) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flowerbed, particularly an elevated one\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A garden with paths between such flowerbeds\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"date\u003d29 August passage\u003dw:Parham Parham House, near in , has a four-acre walled garden that was restored in the Twenties and has been maintained at a high level ever since. It is divided into four areas, one of which is filled by the cut-flower borders and a box-enclosed \u0027\u0027parterre\u0027\u0027. It is traditional in a \u0027\u0027parterre\u0027\u0027 to mix flowers and veg, but this relaxed jungle of productive plants, packed in tight together, is lusher and more beautiful than the more usual Villandry style, where single or pairs of plants are used\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A theater balcony, especially in an opera house; above the box seats, but definitely below family circle\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"That was Selwyn\u0027s first encounter with the Ruthvens. A short time afterward at the opera Gerald dragged him into a \u0027\u0027parterre\u0027\u0027 to say something amiable to one of the amiable débutante Craig girls—and Selwyn found himself again facing Alixe\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An apartment balcony\", \"priority\":6}]}, \"synonyms\":{}}");

	add("parthenocarpy", "{\"term\":\"parthenocarpy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"production of (seedless) fruit without fertilization of ovules\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parthenogenesis", "{\"term\":\"parthenogenesis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"\u0027parthen-\u0027 (biologic and figurative senses: “absence of fertilisation”, “asexual reproduction”; theologic sense: “virgin”) (from Ancient greek (to 1453) \u0027παρθένος\u0027 (virgin) + \u0027-o-\u0027 {{suffix||genesis|gloss2\u003dmode of generation|lang\u003den}} (from Ancient greek (to 1453) \u0027γένεσις\u0027 (origin”, “creation”, “generation)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Reproduction by the development of a single gamete (\u0027viz.\u0027 an ovum or ovule) without fertilisation by a gamete of the opposite sex; compare\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027 October 15, \u0026quot;Virgin Shark Gives Birth\u0026quot;, [http://abc.gov.au/news/stories/2008/10/15/2391404.htm?site\u003dnews AFP via Australian Broadcasting Corporation]: \u0026lt;!-- need article title, author, URL --\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Scientists say the birth is the second confirmed instance of a shark being conceived by \u0027\u0027parthenogenesis\u0027\u0027, a process in which an unfertilised egg develops into a new individual\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Asexual reproduction \u0027in toto\u0027; agamogenesis\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An instance or example of parthenogenesis\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"figurative uses of the biologic senses\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1870\u0027\u0027: w:James Russell James Russell Lowell, \u0027Among My Books\u0027, series I, \u0027Shakespeare Once More\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dbgSQvHJmyIwC\u0026amp;pg\u003dPA223\u0026amp;dq\u003d%22one+sin+involves+another,+and+forever+another,+by+a+fatal+parthenogenesis%22\u0026amp;ei\u003dPx21SvGwL5W-zATylbjsD\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22one%20sin%20involves%20another%2C%20and%20forever%20another%2C%20by%20a%20fatal%20parthenogenesis%22\u0026amp;f\u003dfalse page 223]\u0026lt;/span\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"We may learn, to be sure, plenty of lessons from Shakespeare. We are not likely to have kingdoms to divide, crowns foretold us by weird sisters, a father’s death to avenge, or to kill our wives from jealously ; but Lear may teach us to draw the line more clearly between a wise generosity and a loose-handed weakness of giving ; Macbeth, how one sin involves another, and forever another, by a fatal \u0027\u0027parthenogenesis\u0027\u0027, and that the key which unlocks forbidden doors to our will or passion leaves a stain on the hand, that may not be so dark as blood, but that will not out ; Hamlet, that all the noblest gifts of person, temperament, and mind slip like sand through the grasp of an infirm purpose ; Othello, that the perpetual silt of some one weakness, the eddies of a suspicious temper depositing their one impalpable layer after another, may build up a shoal on which an heroic life and an otherwise magnanimous nature may bilge and go to pieces\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Virgin birth, in reference to the Virgin Mary and Jesus Christ\", \"priority\":10}]}, \"synonyms\":{}}");

	add("parthenolatry", "{\"term\":\"parthenolatry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The worship of virgins, or of the Virgin Mary\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parthenon", "{\"term\":\"parthenon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027παρθενών\u0027 More information: see there.\u0026lt;!-- link, don\u0027t copy --\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ancient temple to Athena and monument in the city of Athens. It is a symbol of Greek achievement in the arts and of Athenian democracy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parthood", "{\"term\":\"parthood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|part|hood|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The relational quality of being a part\", \"priority\":1}]}, \"synonyms\":{}}");

	add("participant", "{\"term\":\"participant\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027participant\u0027 from Latin \u0027participans\u0027 present participle of \u0027participare\u0027 see participate.Category:English words suffixed with -ant\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who participates\", \"priority\":1}]}, \"synonyms\":{}}");

	add("participation", "{\"term\":\"participation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle french (ca. 1400-1600) from Old french (842-ca. 1400) \u0027participacion\u0027 from \u0027participatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of participating, of taking part to a process\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the state of being related to a larger whol\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the process during which individuals, groups and organizations are consulted about or have the opportunity to become actively involved in a project or program of activity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An ownership interest or profit-sharing right\", \"priority\":4}]}, \"synonyms\":{}}");

	add("participle", "{\"term\":\"participle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) Old French|participle\u0027 (1388), ‘a noun-adjective’, variant of \u0027participe\u0027, from Latin \u0027participium\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of a verb that may function as an adjective or noun. English has two types of participles: the present participle and the past participle\", \"priority\":1}]}, \"synonyms\":{}}");

	add("particle", "{\"term\":\"particle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027particule\u0027 and its source, Latin \u0027particula\u0027 (small part, particle) diminutive of \u0027pars\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very small piece of matter, a fragment; especially, the smallest possible part of something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A part of speech which can not be inflected, an adverb, preposition, conjunction or interjectio\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1844\u0027\u0027, E. A. Andrews: \u0027First Lessions in Latin; or Introduction to Andrews and Stoddard\u0027s Latin Grammar.\u0027 (6th edition, Boston), p.91 ([http://books.google.de/books?id\u003dw4MAAAAAYAAJ\u0026amp;pg\u003dPA91 at books.google\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"322. The parts of speech which are neither declined nor conjugated, are called by the general name of \u0027\u0027particles\u0027\u0027. 323. They are adverbs, prepositions, conjunctions, and interjections\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1894\u0027\u0027 (2008), B. L. Gildersleeve \u0026amp; G. Lodge: \u0027Gildersleeve\u0027s Latin Grammar\u0027 (reprint of the 3rd edition by Dover, 2008), p.9. ([https://books.google.de/books?id\u003dPfjBAgAAQBAJ\u0026amp;pg\u003dPA9 at books.google\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The Parts of Speech are the Noun (Substantive and Adjective), the Pronoun, the Verb, and the \u0027\u0027Particles\u0027\u0027 (Adverb, Preposition, and Conjunction\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A word that has a particular grammatical function but does not obviously belong to any particular part of speech, such as the word \u0027to\u0027 in English infinitives or O as the vocative particle\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In English there is no grammatical device to differentiate predicational judgments from nonpredicational descriptions. This distinction does cast a shadow on the grammatical sphere to some extent, but recognition of it must generally be made in semantic terms. It is maintained here that in Japanese, on the other hand, the distinction is grammatically realized through the use of the two \u0027\u0027particles\u0027\u0027 \u0026lt;u\u0026gt;wa\u0026lt;/u\u0026gt; and \u0026lt;u\u0026gt;ga\u0026lt;/u\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Traditional grammar typically recog-\u0026lt;br\u0026gt; nises a number of further categories: for example, in his \u0027Reference Book of\u0026lt;br\u0026gt; Terms in Traditional Grammar for Language Students\u0027, Simpson (1982) posits\u0026lt;br\u0026gt; two additional word-level categories which he refers to as \u0026lt;b\u0026gt;\u0027Particle\u0027\u0026lt;/b\u0026gt;, and\u0026lt;br\u0026gt; \u0027Conjunction\u0027. \u0026lt;b\u0026gt;Particles\u0026lt;/b\u0026gt; include the italicised words in (58) below:\u0026lt;br\u0026gt;(58) (a) \u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp; He put his hat \u0027on\u0027\u0026lt;br\u0026gt;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;(b) \u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp; If you pull too hard, the handle will come \u0027off\u0027\u0026lt;br\u0026gt;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;(c) \u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp; He was leaning too far over the side, and fell \u0027out\u0027\u0026lt;br\u0026gt;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;(d) \u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp; He went \u0027up\u0027 to see the manage\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Any of various physical objects making up the constituent parts of an atom; an elementary particle or subatomic particle\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0026amp; Jeff Forshaw, \u0027The Quantum Universe\u0027, Allen Lane 2011, p. 55\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"What, he asked himself, does quantum theory have to say about the familiar properties of \u0027\u0027particles\u0027\u0027 such as position\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"title\u003dA Palette of volume\u003d100|issue\u003d2|page\u003d146|magazine\u003d|url\u003dhttp://www.americanscientist.org/issues/feature/2012/2/a-palette-of-particles|passage\u003dThe physics of elementary \u0027\u0027particles\u0027\u0027 in the 20th century was distinguished by the observation of \u0027\u0027particles\u0027\u0027 whose existence had been predicted by theorists sometimes decades earlier\", \"priority\":13}]}, \"synonyms\":{}}");

	add("particularist", "{\"term\":\"particularist\", \"etymology\":{\"influencers\":[], \"languages\":[\"French\"], \"text\":\"From {{suffix|particular|ist|lang\u003den}}, after French \u0027particulariste\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who holds to particularism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parting", "{\"term\":\"parting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of parting or dividing; the state of being parted; division; separation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bible, Ezekiel xxi. 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027parting\u0027\u0027 of the way\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A farewell, the act of departing politely\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And there were sudden \u0027\u0027partings\u0027\u0027,such as press / The life from out young hearts\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027, L. Frank Baum, \u0027The Wonderful Wizard of Oz\u0027 Chapter 2\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"But she hugged the soft, stuffed body of the Scarecrow in her arms instead of kissing his painted face, and found she was crying herself at this sorrowful \u0027\u0027parting\u0027\u0027 from her loving comrades\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The dividing line formed by combing the hair in different directions; part (\u0027US\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The surface of the sand of one section of a mould where it meets that of another section\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The separation and determination of alloys; especially, the separation, as by acids, of gold from silver in the assay button\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A joint or fissure, as in a coal seam\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The breaking, as of a cable, by violence\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Lamellar separation in a crystallized mineral, due to some other cause than cleavage, as to the presence of twinning lamellae\", \"priority\":13}]}, \"synonyms\":{}}");

	add("partition", "{\"term\":\"partition\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Recorded c.1430, \u0026quot;division into shares, distinction,\u0026quot; from Old french (842-ca. 1400) \u0027particion\u0027 (modern \u0027partition\u0027), from Latin \u0027partitio\u0027 (division, portion) from \u0027partitus\u0027 the past participle of \u0027partire\u0027 (to split (up), part(ition))\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An action which divides a thing into parts, or separates one thing from another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And good from bad find no \u0027\u0027partition\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A part of something that has been divided\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The division of a territory into two or more autonomous ones\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Monarchies where \u0027\u0027partition\u0027\u0027 isn\u0027t prohibited risk weakening trough parcellation and civil wars between the heir\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A vertical structure that divides a room\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a brick \u0027\u0027partition\u0027\u0027; lath and plaster \u0027\u0027partitions\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"That which divides or separates; that by which different things, or distinct parts of the same thing, are separated; boundary; dividing line or space\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"No sight could pass / Betwixt the nice \u0027\u0027partitions\u0027\u0027 of the grass\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A part divided off by walls; an apartment; a compartment\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Lodged in a small \u0027\u0027partition\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The severance of common or undivided interests, particularly in real estate. It may be effected by consent of parties, or by compulsion of law\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A section of a hard disk separately formatted\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A division of a database or one of its constituting elements such as tables into separate independent parts\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A collection of non-empty, disjoint subsets of a set whose union is the set itself (i.e. all elements of the set are contained in exactly one of the subsets\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A musical score\", \"priority\":19}]}, \"synonyms\":{}}");

	add("partitionist", "{\"term\":\"partitionist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|partition|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a political partisan who favours the partition of the province of Quebec with the western, southern portions and Montreal forming a separate province or country from the rest of Quebec\", \"priority\":1}]}, \"synonyms\":{}}");

	add("partiture", "{\"term\":\"partiture\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"Italian\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The printing of each instrument\u0027s part on a separate stave\", \"priority\":1}]}, \"synonyms\":{}}");

	add("partridge", "{\"term\":\"partridge\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Via Middle english (1100-1500) and Old french (842-ca. 1400) from Latin \u0027perdīx\u0027 (partridge) from Ancient greek (to 1453) \u0027πέρδιξ\u0027 (partridge)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any bird of a number of genera in the family \u0027Phasianidae\u0027, notably in the genera \u0027Perdix\u0027 and \u0027Alectoris\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A type cannon charge composed of several missiles fired all together, similar to langrage or case-shot. Also a large cannon that shoots stones\", \"priority\":2}]}, \"synonyms\":{}}");

	add("partwork", "{\"term\":\"partwork\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|part|work|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A written publication released as a series of pre-planned magazine-like issues over a period of time, distributed through the same channels as magazines\", \"priority\":1}]}, \"synonyms\":{}}");

