	add("parure", "{\"term\":\"parure\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Old french (842-ca. 1400) \u0027pareure\u0027 \u0027parure\u0027 See French \u0027parure\u0027 below.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A set of jewellery to be worn together\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, Kyril Bonfiglioli, \u0027After You with the Pistol\u0027 (Penguin 2001, p. 202\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Why, then, was she not in Bond Street, as advertised, scribbling her signature on Travellers\u0027 Cheques and scooping up emerald \u0027\u0027parures\u0027\u0027 and things\", \"priority\":3}]}, \"synonyms\":{}}");

