	add("parvo", "{\"term\":\"parvo\", \"etymology\":{\"influencers\":[], \"languages\":[\"Latin\", \"Portuguese\"], \"text\":\"From Latin \u0027parvulus\u0027 diminutive of \u0027parvus\u0027 from metathesized form of Proto-indo-european {{m|ine-pro|*pau-ro}}, from {{m|ine-pro|*ph₁w-||few, small}}. Cognate with Galician {{m|gl|parvo}} and Spanish {{m|es|parvo}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"parvoviru\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, \u0027Business Week\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Inoculating a dog against \u0027\u0027parvo\u0027\u0027 costs about $7 to $15 for the shot, depending on your area and choice of veterinarian\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Mike Harlowe, \u0027K-9 Bodyguards: Ill\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He will probably be next to a street cur that has \u0027\u0027parvo\u0027\u0027 or rabies or distemper\", \"priority\":5}]}, \"synonyms\":{}}");

	add("parvenu", "{\"term\":\"parvenu\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027parvenu\u0027 past participle of \u0027parvenir\u0027 from Latin \u0027perveniō\u0027 (arrive, reach) See also \u0027lang\u003den\u0027 \u0026lt;!-- ? --\u0026gt; Parvenu/parvenue is one of the few words in English which has two forms distinguished according to gender.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who has risen, climbed up, or has been promoted to a higher social class, especially through acquisition of wealth, rights, or political authority but has not gained social acceptance by those within that new class\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, January 31, Francis Wheen, \u0026quot;The whole truth about Peter\u0027s friends\u0026quot;, \u0027The Guardian\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But the favourite\u0027s power and influence provoke intense ill-feeling among other courtiers, who regard him as a sinister, usurping \u0027\u0027parvenu\u0027\u0027 with ideas above his station, or perhaps even a sorcerer\", \"priority\":3}]}, \"synonyms\":{}}");

	add("parvis", "{\"term\":\"parvis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027parvis\u0027 Middle french (ca. 1400-1600) \u0027parvis\u0027 from \u0027paradisus\u0027 () (used in the Middle Ages to describe the court in front of St Peter\u0027s in Rome, and later similar courts in front of other churches).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An enclosed courtyard in front of a building, especially a cathedral\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A portico surrounding such a space\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The porch of a church, or the room over it\", \"priority\":3}]}, \"synonyms\":{}}");

